import React from 'react';
import API from '../Api';//Cambiar a constantes
import axios from 'axios';
import {DataTable,Column} from 'primereact/datatable';
import {Button} from 'primereact/button';


class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { fiduca: {data:[]} };
        
    }

    llamada() {
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        this.llamada().then(data => {
            this.setState({fiduca: data});
        });
        
    }
    
    render() {
        let header = (
            <div style={{'textAlign':'left'}}>
                <i className="pi pi-search" style={{margin:'4px 4px 0 0'}}></i>
                <InputText type="search" onInput={(e) => this.setState({globalFilter: e.target.value})} placeholder="Global Search" size="50"/>
            </div>
        );

        return (
            <div className="datatable-doc-demo">
                <DataTable value={this.state.cars} paginator={true} rows={10} header={header} globalFilter={this.state.globalFilter}>
                    <Column field="vin" header="Vin" filter={true} />
                    <Column field="year" header="Year" filter={true} />
                    <Column field="brand" header="Brand" filter={true} />
                    <Column field="color" header="Color" filter={true}  />
                </DataTable>
            </div>
        );
    }
}
export default BienesApi;
